import React from "react";
import { Routes, Route } from "react-router-dom";


import PPICProd from "./components/PPIC&QCW1/PPIC.jsx"
import InputModel from "./components/InputModel.jsx"
import Pin from "./components/Pin.jsx"
import QCProd from "./components/PPIC&QCW1/QC.jsx"


function App() {
  return (
    <>
      <Routes>
      <Route path="/" element={<PPICProd/>}/>
        <Route path="PPICW1" element={<PPICProd/>}/>
        <Route path="QCProd" element={<QCProd/>}/>
        <Route path="Pin" element={<Pin/>}/>
        <Route path="InputModel" element={<InputModel/>}/>
      </Routes>
    </>
  );
}

export default App;
